import { FC, ReactNode } from "react";
import styled from "styled-components";

interface IProps {
  children: ReactNode;
}

const StyledHeader = styled.h1`
  font-family: sans-serif;
`;

export const Header: FC<IProps> = ({ children }) => (
  <StyledHeader>{children}</StyledHeader>
);
